import { SET_DANH_SACH_SV } from "../constant/quanlySvConstant";

let initialState = {
  dssv: [],
};

export const quanlySvReducer = (state = initialState, action) => {
  switch (action.type) {
    case SET_DANH_SACH_SV:
      state.dssv = action.payload;
      return { ...state };

    default:
      return { ...state };
  }
};
